import './css/App.css';
import React,{useEffect} from 'react'
import Checksign from './chk_sign'
import Head from './head'



function App() {
    useEffect(()=>{
        fetch('http://localhost:8000/login_state')
        .then(res=>res.json())
        .then((data)=>{
            if(data[0].status === 1){
                return (
                    <div className="App">
                        <Head/>
                    </div>
                );
            }
            else{
                return (
                    <div className="App">
                        <Checksign />
                    </div>
                );
            }
        })
    })
}

export default App;
